import React from "react";
import Button from "@mui/material/Button";

const JobList = () => {
  // Example job data
  const jobs = [
    {
      id: 1,
      title: "Software Engineer",
      company: "Tech Corp",
      region: "Remote",
      type: "Full Time",
    },
    {
      id: 2,
      title: "Product Manager",
      company: "Innovate Inc",
      region: "New York",
      type: "Full Time",
    },
    {
      id: 3,
      title: "Data Analyst",
      company: "Data Works",
      region: "San Francisco",
      type: "Part Time",
    },
  ];

  return (
    <div>
      <h2 style={{ textAlign: "left", marginLeft: "30px" }}>RECENT JOBS</h2>
      <div style={styles.jobList}>
        {jobs.map((job) => (
          <div key={job.id} style={styles.jobItem}>
            <h2>{job.title}</h2>
            <p>{job.company}</p>
            <p>
              {job.region} - {job.type}
            </p>
          </div>
        ))}
        <Button
          variant="contained"
          style={{
            padding: "6px 12px", // Smaller padding for a smaller button
            fontSize: "0.875rem", // Smaller font size
            backgroundColor: "#16a085", // Teal background
            color: "#ffffff", // White text
            borderRadius: "4px", // Slightly rounded corners
            transition: "background-color 0.3s",
            cursor: "pointer",
            margin: "10px", // Add margin for spacing
            display: "inline-block", // Ensure it behaves like a block element
          }}
          onMouseEnter={(e) =>
            (e.currentTarget.style.backgroundColor = "#149174")
          }
          onMouseLeave={(e) =>
            (e.currentTarget.style.backgroundColor = "#16a085")
          }
        >
          Get More Jobs hre
        </Button>
      </div>
    </div>
  );
};

const styles = {
  jobList: {
    display: "flex",
    flexDirection: "column",
    marginLeft: "20px",
  },
  jobItem: {
    border: "1px solid #ddd",
    borderRadius: "5px",
    padding: "20px",
    margin: "10px",
    width: "80%",
    textAlign: "left",
  },
};

export default JobList;
